    return (
      <select
        value={value}
        name="role slect"
        id="role-select"
        onChange={handleChange}
      >
        {selections.map(role => (
          <option key={role.value} value={role.value}>
            {role.label}
          </option>
        ))}
      </select>
    );
  }
